def change_positions_to_blue(input: List[List[int]], positions: List[Tuple[int, int]]) -> List[List[int]]:
    for i, j in positions:
        if i > 0:
            input[i - 1][j] = blue
        if i < len(input) - 1:
            input[i + 1][j] = blue
        if j > 0:
            input[i][j - 1] = blue
        if j < len(input[i]) - 1:
            input[i][j + 1] = blue
    return input

