def change_corners_to_grey(input: List[List[int]], positions: List[Tuple[int, int]]) -> List[List[int]]:
    for i, j in positions:
        if i > 0 and j > 0:
            input[i - 1][j - 1] = grey
        if i > 0 and j < len(input[i]) - 1:
            input[i - 1][j + 1] = grey
        if i < len(input) - 1 and j > 0:
            input[i + 1][j - 1] = grey
        if i < len(input) - 1 and j < len(input[i]) - 1:
            input[i + 1][j + 1] = grey
    return input

